#include <iostream>
#include <string>
#include <vector>
#include <algorithm> 

using namespace std;

bool IsPalindrome(const string& text) {
    
    if(text == "" || text == " "){
        return false;
    }
    
    string textx = text;
    vector<string>words;
    string word;
    for (int i = 0; textx.size() > i;) {

        if (textx[i] == ' ') {
            textx.erase(0, 1);
        } 
        else {
            break;
        }
        ++i;
    }
    int textxs = textx.size();
    if (textxs > 0) {

        for (int i = 0; i < textx.size();) {

            if (textx[i] == ' ') {
                words.push_back(word);
                word.erase();
            }
            else {
                word.push_back(textx[i]);
            }
            ++i;
            if (textx.size() == i && textx[i]!= ' ') {
                words.push_back(word);
                word.erase();
            }
        }
    } else {
        return false;
    }
    
    string allrev;

    for (auto s : words) {
        allrev = allrev + s;
    }
    word = allrev;
    reverse(allrev.begin(), allrev.end());
    if (word == allrev) {
        return true;
    }

    return false;
}

int main() {

    string text;
    getline(cin, text);

    if (IsPalindrome(text)) {
        cout << "palindrome"s << endl;
    }
    else {
        cout << "not a palindrome"s << endl;
    }
    
}

