int main()
{
    ios_base::sync_with_stdio(false);
    cin.tie(NULL);

    size_t n, hungerLevel, max = 0, currCount, top;
    cin >> n;

    stack<size_t> original, finalists;

    for (size_t i = 0; i < n; i++) {
        cin >> hungerLevel;
        original.push(hungerLevel);
    }
    stack<size_t> first = original;
        int days = 0;
        bool isFinal = false;
        while (!isFinal)
        {
            days++;
            if (days > 50)
                break;
            int startCount = original.size();
            finalists.push(original.top());
            original.pop();
            while (!original.empty()) {
                int top = original.top();
                original.pop();
                if (finalists.top() > top)
                    finalists.pop();
                finalists.push(top);
            }
            while (!finalists.empty()) {
                original.push(finalists.top());
                finalists.pop();
            }
            if (startCount == original.size())
                isFinal = true;
        }
         if (isFinal) {
            cout << --days;
            return 0;
        }
    
    original = first;
    stack<size_t> second;
    finalists = second;
    while (!original.empty()) {
        top = original.top();
        original.pop();

        currCount = 0;
        while (!finalists.empty() && finalists.top() > top) {
            finalists.pop();
            currCount++;
        }

        if (currCount > max)
            max = currCount;
        finalists.push(top);
    }
    cout << max;
}

